// Expressão regular para extrair os nomes dos ícones
const regex = /index_(\w+) as (\w+)/g;

// Função para extrair os nomes dos ícones
function extractIconNames(iconsString) {
    const matches = [...iconsString.matchAll(regex)];
    // Retorna apenas o segundo grupo capturado (o nome do ícone) e envolve em aspas duplas
    return matches.map(match => `"${match[2]}"`);
}

const iconNames = extractIconNames(iconsString);
console.log(iconNames.join(', '));